@Test public void should_print_method_name(){try {verify(mock).simpleMethod();fail();}catch(WantedButNotInvoked e){String actualMessage=e.getMessage();String expectedMessage="
" + "Wanted but not invoked:" + "
"+ "iMethods.simpleMethod();"+ "
"+ "-> at";assertContains(expectedMessage,actualMessage);}}

@Test public void should_print_actual_and_wanted_in_line(){mock.varargs(1,2);try {verify(mock).varargs(1,1000);fail();}catch(ArgumentsAreDifferent e){String wanted="
" + "Argument(s)are different! Wanted:" + "
"+ "iMethods.varargs(1,1000);";assertContains(wanted,e.getMessage());String actual="
" + "Actual invocation has different arguments:" + "
"+ "iMethods.varargs(1,2);";assertContains(actual,e.getMessage());}}

@Test public void should_print_first_unexpected_invocation(){mock.oneArg(true);mock.oneArg(false);mock.threeArgumentMethod(1,"2","3");verify(mock).oneArg(true);try {verifyNoMoreInteractions(mock);fail();}catch(NoInteractionsWanted e){String expectedMessage="
" + "No interactions wanted here:" + "
"+ "-> at";assertContains(expectedMessage,e.getMessage());String expectedCause="
" + "But found this interaction on mock '" + mock + "':"+ "
"+ "-> at";assertContains(expectedCause,e.getMessage());}}

@Test public void should_print_first_unexpected_invocation_when_verifying_zero_interactions(){mock.twoArgumentMethod(1,2);mock.threeArgumentMethod(1,"2","3");try {verifyZeroInteractions(mock);fail();}catch(NoInteractionsWanted e){String expected="
" + "No interactions wanted here:" + "
"+ "-> at";assertContains(expected,e.getMessage());String expectedCause="
" + "But found this interaction on mock '" + mock + "':"+ "
"+ "-> at";assertContains(expectedCause,e.getMessage());}}

