@Test public void shouldPrintVerificationInOrderErrorAndShowWantedOnly(){try {inOrder.verify(one).differentMethod();fail();}catch(WantedButNotInvoked e){String expected="
" + "Wanted but not invoked:" + "
"+ "iMethods.differentMethod();"+ "
"+ "-> at";assertContains(expected,e.getMessage());}}

@Test public void shouldPrintMethodThatWasNotInvoked(){inOrder.verify(one).simpleMethod(1);inOrder.verify(one).simpleMethod(11);inOrder.verify(two,times(2)).simpleMethod(2);inOrder.verify(three).simpleMethod(3);try {inOrder.verify(three).simpleMethod(999);fail();}catch(VerificationInOrderFailure e){String actualMessage=e.getMessage();String expectedMessage="
" + "Verification in order failure" + "
"+ "Wanted but not invoked:"+ "
"+ "iMethods.simpleMethod(999);";assertContains(expectedMessage,actualMessage);}}

